import React from 'react';

const AboutUs = () => {
  return (
    <div className="p-4">
      <div
        className="bg-cover bg-center flex flex-col items-stretch justify-end rounded-xl pt-[132px]"
        style={{
          backgroundImage: `linear-gradient(0deg, rgba(0, 0, 0, 0.4) 0%, rgba(0, 0, 0, 0) 100%), url(https://lh3.googleusercontent.com/aida-public/AB6AXuCk0R4AvmgzQ53jHhCtEeKF_OyVmod1g4GFUQVmdsnFemdPtfGCieXJHlAYzLNcW3CMXpBKW4TlKK-vd5qgwTwUiR4GV8UadN98U-_fqzkFIs4zNQ1Fwoh-su34CM8iVFaQMtXdywaEG_LSQkMCGVuKEft6DMlkM3k4IoSFqWkVdGv8Eko4nMHrSuG7jyAA32stQ-ZIz60oXByXxtd2NxOa4N5Ba3GjpGxpU_zpZY820gavTMzOaQxJXkUX2NgyLgX5hrJzt-bx6-c)`
        }}
      >
        <div className="flex w-full items-end justify-between gap-4 p-4">
          <div className="flex max-w-[440px] flex-1 flex-col gap-1">
            <p className="text-white tracking-light text-2xl font-bold leading-tight max-w-[440px]">Harmonic Motion</p>
            <p className="text-white text-base font-medium leading-normal">
              Harmonic Motion is a dynamic music band specializing in film song performances. Founded in 2015, the band has captivated audiences with their unique
              renditions of iconic film scores and soundtracks. Our mission is to bring the magic of cinema to life through music, creating unforgettable experiences for
              our listeners.
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default AboutUs;
